import React from 'react';
import Image from 'react-image-resizer';
import picture from './disneylandcur.jpg'; // Tell Webpack this JS file uses this image

function disney() {

    return (
      <div>
        <Image
          img src={picture} alt="icon" class="center"
          //src="./logo.png"
          height={50}
          width={50}
        />
      </div>
    );

}

export default disney;
